import React from "react";
import WhoToFollowListItem from "./WhoToFollowListItem";
import who from "./who.json";


const WhoToFollowList = () => {
    return (`
            <ul class="list-group">
            {who.map(whoItem => {
                 return(
                     <WhoToFollowListItem who={whoItem}/>
                 );
     })
 }

            </ul>
    `);
}

export default WhoToFollowList;
